    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

function App(){
    return (
        <Router>
            <Container>
            <NVBar/>
            <Switch>
                <Route path="/">
                   
                </Route>
                <Route path="/about">
                    <div>Hello</div>
                </Route>
                <Route path="/login">
                    <Login/>
                </Route>
            </Switch>
            
            <Footer/>
            </Container>
        </Router> 
    )
}

export default App;
